import React from 'react'

function MovieItem(props) {
  return (
    <li>
      <a href="/">
      <img
          src={`https://image.tmdb.org/t/p/w342${props.movie.poster_path}`}
          alt={props.movie.title}
        />
        <p>
          {props.movie.snippet.title}
        </p>
      </a>
    </li>
  )
}

export default MovieItem
